import React from "react";

export default function UserItem(props) {
  return (
    <Link to="/chatroom" onClick={() => props.setSelectedUser(user)}>
      {user.get("username")}{" "}
      <div className="user-item">
        <h1>{props.username}</h1>
        <h1>{props.nationality}</h1>
        <h1>{props.status}</h1>
        <img src={props.photo}>{props.photo}</img>
      </div>
    </Link>
  );
}
